      .FastFood-wrap ul {
        transform: translate(0%, -1%);
        width: 73%;
        height: 73%;
        display: grid;
        grid-template-columns: 33% 33% 33%;
        grid-template-rows: 33% 33% 33%;
      }

      .FastFood-wrap ul li {
        width: 100%;
        height: 100%;

        position: relative;
      }

      .FastFood-wrap ul li:nth-child(5) {
        grid-column-start: 2;
        grid-column-end: 3;
        grid-row-start: 2;
        grid-row-end: 3;
      }

      .FastFood-wrap ul li img {
        width: 82%;
      }

      .start {
        display: flex;
        justify-content: center;
        align-items: flex-end;
        width: 100%;
        height: 100%;
        background-repeat: no-repeat;
        background-size: 80% 80%;
        background-position: center center;
      }

      .FastFood-wrap ul li.xx .item-xx {
        width: 1rem;
        height: 1rem;
        line-height: 0.4rem;
        margin: 0.2rem auto 0 auto;
        background-color: #041726;
        padding: 0.14rem 0.14rem 0.14rem 0.16rem;
        font-size: 0.33rem;
        color: #035d68;
      }

      .FastFood-wrap ul li.rw {
        display: flex;
        justify-content: center;
        align-items: center;
        /* background-image: v-bind("'url(' + imageReat.bgItem + ')'") ; */
        background-repeat: no-repeat;
        background-size: 100% 100%;
        background-position: center center;
      }

      .FastFood-wrap ul li.rw .header {
        display: flex;
        height: 30%;
        justify-content: center;
      }

      .header {
        display: flex;
        height: 30%;
        justify-content: center;
      }

      .FastFood-wrap ul li.rw img {
        width: 76%;
        height: 76%;
        /* margin: 0 0 0 5px; */
      }

      .FastFood-wrap ul li.rw .name {
        width: 100%;
        height: 100%;
        line-height: 0.32rem;
        margin: 0 auto;
        text-align: center;
        font-size: 0.23rem;
        /* background-image: url("img/name_bg.png"); */
        background-repeat: no-repeat;
        background-size: 100% 100%;
        background-position: center center;
        color: #00ffff;
      }

      .FastFood-wrap ul li.active {
        /* background-size: 104% 102%; */
        /* background-position: 106% 135%; */
        background-color: #fcdc1c;
        border-radius: 20px;
      }

      .FastFood-wrap ul li.active::after {
        content: " ";
        display: block;
        position: absolute;
        top: 0;
        left: 0.05rem;
        width: 100%;
        height: 100%;
        /* background-color: rgba(188, 133, 28, 0.3); */
      }

      .FastFood-wrap ul li.active .name {
        /* background-image: url('img/name_current_bg.png'); */
        /* background-repeat: no-repeat;
          background-size: 100% 100%;
          background-position: center center;
          color: #fff; */
      }

      .FastFood-wrap-img {
        width: 84%;
        position: absolute;
        top: -20%;
        left: 7%;
        z-index: 8;
      }

      .home-box {
        display: none;
        width: 100vw;
        height: 100vh;

        overflow: hidden;
        display: flex;
        justify-content: center;
        align-items: center;
      }

      .home-box img {
        width: 70%;
      }

      .FastFood-progress-bar {
        position: relative;
        width: 54%;
        height: 15px;
        border-radius: 20px;
        background-color: #f6e27a;
      }

      .FastFood-progress {
        width: 0;
        height: 15px;
        border-radius: 20px;
        background-color: #fff;
      }

      .FastFood-progress::after {
        content: "";
        display: block;
        position: absolute;
        top: -3px;
        width: 10px;
        height: 20px;
        border-radius: 20px;
        background-color: #fff;
      }

      .clearDialog {
        /* margin-top: -63%; */
        margin-left: 31%;
        width: 100px;
        height: 100px;
      }

    function FastFoodinit() {
      content = document.getElementById("content");
      container = document.getElementById("container");
      homeBox = document.getElementById("home-box");
      result = document.getElementById("result");
      setting = document.getElementById("FastFood-setting-box");
      settingBtn = document.getElementById("FastFood-setting");
      listpage = document.getElementById("FastFood-list");
      backBox = document.getElementById("FastFood-header");
      count = document.getElementById("FastFood-count");
      progressBar1 = document.querySelector(".progressbar1");
      progressBar2 = document.querySelector(".progressbar2");
      settingIcon1 = document.querySelector(".settingIcon1");
      settingIcon2 = document.querySelector(".settingIcon2");
      progress1 = document.querySelector(".progress1");
      progress2 = document.querySelector(".progress2");
      countValue = parseInt(sessionStorage.getItem("countValue")) || 112;
      count.innerHTML = countValue;
      magicContainer = document.getElementById("FastFood-container");
      settingIcon1.src = imgSetting.img2;
      settingIcon2.src = imgSetting.img4;
      FastFoodprogressFn(progressBar1, progress1, settingIcon1);
      FastFoodprogressFn(progressBar2, progress2, settingIcon2);

      FastFoodcreatedHTML();
    }

    function FastFoodprogressFn(progressBarPP, progressPP, settingIcon) {
      let isDragging = false;

      progressBarPP.addEventListener("mousedown", (e) => {
        e.stopPropagation(); // 阻止事件冒泡
        isDragging = true;
        FastFoodprogressFn(e, progressBarPP, progressPP);
      });

      progressBarPP.addEventListener("mousemove", (e) => {
        e.stopPropagation(); // 阻止事件冒泡

        if (isDragging) {
          FastFoodprogressFn(e, progressBarPP, progressPP);
        }
      });

      progressBarPP.addEventListener("mouseup", () => {
        e.stopPropagation(); // 阻止事件冒泡

        isDragging = false;
      });
      settingIcon.addEventListener("click", (e) => {
        e.stopPropagation(); // 阻止事件冒泡

        if (progressPP == progress1) {
          settingIcon.src =
            settingIcon.src == imgSetting.img2
              ? imgSetting.img1
              : imgSetting.img2;
        } else if (progressPP == progress2) {
          settingIcon.src =
            settingIcon.src == imgSetting.img3
              ? imgSetting.img4
              : imgSetting.img3;
        }
      });
    }

    function FastFoodprogressFn(e, progressBarPP, progressPP) {
      const progressBarRect = progressBarPP.getBoundingClientRect();
      const width = e.clientX - progressBarRect.left;
      const progressBarWidth = progressBarRect.width;

      const percentage = (width / progressBarWidth) * 100;

      progressPP.style.marginLeft = percentage + "%";
      if (progressPP == progress1 && percentage > 0) {
        settingIcon1.src = imgSetting.img1;
      } else if (progressPP == progress2 && percentage > 0) {
        settingIcon2.src = imgSetting.img3;
      }
    }

    function FastFoodresults() {
      result.style.display = "none";
    }
    function FastFoodsettingFn(event, val) {
      if (val) {
        setting.style.display = "none";
      } else {
        setting.style.display = "flex";
      }
    }

    function FastFoodcreatedHTML() {
      content.innerHTML = "";
      contentHtml = "";
      obj.resultList.forEach((item, index) => {
        contentHtml += `<li class="${
          item.order >= 1
            ? item.order == obj.index - 1
              ? "rw active"

        }">

    function FastFoodFastFoodgoPageNo(type) {
      let dialog = document.getElementById("FastFood-dialog-box");
      if (type) {
        dialog.style.display = "none";
      } else {
        dialog.style.display = "flex";
      }
    }
    const FastFoodallMethods = {
      FastFoodFastFoodgoPageNo: () => {
        var slots = document.getElementsByClassName("slot");
        // 移除所有slot的结果类名
        for (var i = 0; i < slots.length; i++) {
          slots[i].classList.remove("result");
        }

        // 随机选取一个结果
        var randomIndex = Math.floor(Math.random() * slots.length);

        // 添加结果类名
        slots[randomIndex].classList.add("result");

        // 滚动到选中的结果位置
        var board = document.getElementById("roulette-board");
        var selectedSlot = slots[randomIndex];
        var boardRect = board.getBoundingClientRect();
        var selectedSlotRect = selectedSlot.getBoundingClientRect();
        var offsetTop = selectedSlotRect.top - boardRect.top;
        var offsetLeft = selectedSlotRect.left - boardRect.left;
        board.style.transform =
          "translate(" + -offsetLeft + "px, " + -offsetTop + "px)";

        // 显示抽奖结果
        var resultdd = slots[randomIndex].innerText;

        // 3秒后重置轮盘位置
        setTimeout(function () {
          board.style.transform = "translate(0, 0)";
        }, 3000);
      },
      FastFoodstartGo() {
        if (!obj.isTurn) return;
        obj.isTurn = false; // 等待下一次开启 注：接口失败等异常情况 需要重置
        // await api 获取中奖信息 （因为数据结构的定义，这里拿到中奖位置将变得非常 esay）
        let win = FastFoodrandomNum(1, 8); // 中奖位置
        if (!win) return;
        //   this.$emit('change', 'start', {})
        obj.lotterywin = win;
        FastFoodallMethods.FastFood_rolling();
      },
      FastFoodresetData() {
        // 数据重置
        obj.index = 2;
        obj.isTurn = true;
        obj.lottery = {
          count: 9, // 位置数量 九宫格八个奖品位置
          timer: 0, // setTimeout 容器
          speed: 40, //初始转动速度
          times: 0, //转动次数
          cynum: FastFoodrandomNum(40, 60), // 圈数
          end: 0, //中奖位置 0 默认不中奖
        };
      },
      FastFood_roll_actived() {
        // running 选中的状态
        if (obj.index > obj.lottery.count) obj.index = 1;
      },
      FastFood_rolling() {
        obj.lottery.times++;

        FastFoodallMethods.FastFood_roll_actived();

        // +10 将速度降下来的圈数周期
        if (
          obj.lottery.times > obj.lottery.cynum + 10 &&
          obj.lotterywin === obj.index
        ) {
          open.value = true;
          // router.push('/over')
          result.style.display = "block";
          countValue +=
            countValue + Math.floor(Math.random() * (3000 - 1000 + 1)) + 1000;
          count.innerHTML = countValue;
          sessionStorage.setItem("countValue", countValue);
          clearTimeout(obj.lottery.timer);
          setTimeout(() => {
            FastFoodallMethods.FastFoodresetData();
            //   this.$emit('change', 'fin', {})
          }, 1000); // 此时间给予用户感受中奖反馈时间
        } else {
          obj.index++;
          FastFoodcreatedHTML();
          if (obj.lottery.times > obj.lottery.cynum) obj.lottery.speed += 20; // 惯性 越来越慢
          obj.lottery.timer = setTimeout(
            FastFoodallMethods.FastFood_rolling,
            obj.lottery.speed
          );
        }
      },
      FastFoodopenDialog() {
        open.value = !open.value;
      },
      FastFoodgoBack() {
        if (!obj.isTurn) return;
        if (pageType == "list") {
          backBox.style.display = "none";
          container.style.display = "none";
          homeBox.style.display = "";
          listpage.style.display = "none";
          settingBtn.style.display = "none";
        } else {
          container.style.display = "none";
          listpage.style.display = "flex";
          settingBtn.style.display = "block";
          pageType = "list";
        }
      },
      FastFoodgoPlay() {
        pageType = "list";
        backBox.style.display = "block";
        settingBtn.style.display = "block";
        homeBox.style.display = "none";
        listpage.style.display = "flex";
      },
    };
    function FastFoodgoPage() {
      pageType = "page";
      // settingBtn.style.display = "none";
      container.style.display = "block";
      listpage.style.display = "none";
    }
    function FastFoodrandomNum(minNum, maxNum) {
      switch (arguments.length) {
        case 1:
          return parseInt(Math.random() * minNum + 1, 10);
          break;
        case 2:
          return parseInt(Math.random() * (maxNum - minNum + 1) + minNum, 10);
          break;
        default:
          return 0;
          break;
      }
    }
  </script>

  <body onload="FastFoodcreateElementApp()">
    <div id="FastFood-app"></div>
  </body>
</html>
